import React, { Component } from 'react';
import './Feed.css';

import more from '../assets/more.svg';

class Feed extends Component {

    render(){

        return(

            <section id="post-list">

                <article>

                    <header>

                        <div className="user-info">

                            <span>Felipe Alves</span>
                            <span className="plae">Rio do Sul</span>
                        </div>
                    </header>
                </article>
            </section>
        )
    }
}

export default Feed;
